import React from 'react';
import { getSuggestions } from './utils/suggestions';
 // Ensure the correct path

const FarmerWeather = ({ weatherData, weather, city, windData }) => {
  const suggestion = getSuggestions(weather, 'farmer');

  return (
    <div className='weatherData'>
      <div className='currtemp'>
        <div className='tempAndLogo'>
          <div>
            <img src={`assets/${weather.icon}.svg`} width={200} alt='icon' />
          </div>
          <div>
            {Math.round(weatherData.temp)}&deg;C
            <p>{weather.description}</p>
          </div>
        </div>
        <div className='windData'>
          <p>Wind: <span>{windData.speed} mph</span></p>
          <p>Humidity: <span>{weatherData.humidity} %</span></p>
          <p>Pressure: <span>{weatherData.pressure} mb</span></p>
        </div>
      </div>
      <div className='suggestion'>
        <h3>Suggestion:</h3>
        <p>{suggestion}</p>
      </div>
    </div>
  );
};

export default FarmerWeather;
